     */
    public static function retrieveByPK($id, $version, PropelPDO $con = null) {
        $_instancePoolKey = serialize(array((string) $id, (string) $version));
         if (null !== ($obj = BookingVersionPeer::getInstanceFromPool($_instancePoolKey))) {
             return $obj;
        }

        if ($con === null) {
            $con = Propel::getConnection(BookingVersionPeer::DATABASE_NAME, Propel::CONNECTION_READ);
        }
        $criteria = new Criteria(BookingVersionPeer::DATABASE_NAME);
        $criteria->add(BookingVersionPeer::ID, $id);
        $criteria->add(BookingVersionPeer::VERSION, $version);
        $v = BookingVersionPeer::doSelect($criteria, $con);

        return !empty($v) ? $v[0] : null;
